public class StringCount {
    public static void main(String[] args) {
        int cnt=1;
        String s="";
        for(int i=0;i<s.length();i++)
        {
            if(s.charAt(i)>'A'&& s.charAt(i)<'Z')
            {
                cnt++;
            }
        }
        System.out.println(cnt);

    }
}
